/**
 * @description Get the vacbot current map.
 * @returns {Promise<object>} Promise object representing the current map image for the vacbot.
 * @example
 * vacbot.getMap();
 */
async function getMap(deviceExternalId) {
  // TODO: is there a better way to do this ?
  let vacbot;
  this.vacbots.forEach((value, key) => {
    if (key.external_id === deviceExternalId) {
      vacbot = value;
    }
  });
  const mapImage = "data:image/png;base64,";  
  return mapImage;
};

module.exports = {
  getMap,
};
